import React from 'react';

const Wallets = () => {
	function FetchWallets() {
		const { isLoading, error, data } = useQuery({
			queryKey: ['repoData'],
			queryFn: () =>
				fetch(
					'https://api.github.com/repos/tannerlinsley/react-query'
				).then((res) => res.json()),
		});
	}
	return <div>Wallets</div>;
};

export default Wallets;
